ちゃぶ台をイメージしたアルミ製のテーブルです。<br>運動会や花見などで手頃なテーブルがあればと思った事ありませんか？<br>タクミちゃんは丁度良いサイズですし、車内で使うのにも便利です。<br>防水仕様のレジャーシート（ブラック）がセットになっておりますのでサッと広げてどこでもピクニック気分に。<br><br>
 <img src=" http://image.rakuten.co.jp/ainekusu/cabinet/02749100/03318947/imgrc0068704462.jpg"><br><br>最大の特徴とも言える「付属プレート」と別売のキズナけーぶるやアルミ製自在アームをチョイスして色々と組み合わせれば家族で使うのに便利なシガーソケットやUSBコンセント付きのテーブルに早変わり。<br>直流家シリーズ製品を使って楽しいアウトドアライフを味わう事が出来ます。<br><br>【仕様】<br>品番／JPN-DC620<br>
 JANコード／4532332999876<br>
■折畳サイズ　W400×D302×H67mm<br>
 ■組立サイズ　W600×D400×H250～420ｍｍ<br>
■本体材質　アルミ合金<br>
■天板材質　化粧板<br>
■付属品　防水シート（200cm角）・アルミプレート<br><style type="text/css">
